import React, {useEffect} from 'react';
import YourPageInSider from './../Components/NewFeed/YourPageInSider.jsx';
import axios from 'axios';
import {API_MY_PAGE} from './../Constants/Api.jsx';
import {useSelector, useDispatch} from 'react-redux';
import {saveMyPages} from './../Actions/index.jsx';
import {fetchMyPages} from './../Actions/index.jsx';

function YourPageInSiderContainer({ myPagesStore }){
  const myPages = useSelector(state => state.myPagesStore);
  const dispatch = useDispatch();

  useEffect(() => {
    console.log(getApiYourPage());
  }, [])

  const getApiYourPage = async () => {
      await axios.get('/api/auth/my-pages').then((res) => {

        dispatch(saveMyPages(res.data))
      }).catch((err) => {
        console.log(err);
      })
  }

  return(
    <YourPageInSider />
  )
}
export default YourPageInSiderContainer;
